import React from 'react';
import Fridge from './Fridge';
import Results from './Results';
import './CSS/App.css'
import { Container, Grid} from 'semantic-ui-react'

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      ingredients: [],
      results: [],
    }
  }

  render() {
    return (
      <Container>
        <Grid columns={2} relaxed='very'>
          <Grid.Column>
            <Fridge />
          </Grid.Column>
          <Grid.Column>
            <Results />
          </Grid.Column>
        </Grid>
      </Container>
    );
  }
}


export default App;
